import React from 'react';
import style from "./Home.module.css";

import NavBar from "../NavBar/NavBar.jsx";
import Filter from "../Filters/Filter.jsx";


import Recipes from "../Recipes/Recipe.jsx";

function Home(){
 
    return (
        <React.Fragment>
            <div className={style.container}>
                <NavBar></NavBar>
                <Filter></Filter>
                <Recipes></Recipes>
            </div>
        </React.Fragment>
    )
}

export default Home;
